// Calculate price statistics
export const priceStats = {
  min: Math.min(...properties.map(p => p.pricePerUnit)),
  max: Math.max(...properties.map(p => p.pricePerUnit)),
  avg: properties.reduce((sum, p) => sum + p.pricePerUnit, 0) / properties.length,
};

// Get price color based on value (green for low, yellow for medium, red for high)
export function getPriceColor(price: number): string {
  const normalized = (price - priceStats.min) / (priceStats.max - priceStats.min);

  if (normalized < 0.33) {
    return '#22c55e'; // green
  } else if (normalized < 0.66) {
    return '#eab308'; // yellow
  } else {
    return '#ef4444'; // red
  }
}

// Get heatmap intensity (0-1) based on price
export function getHeatmapIntensity(price: number): number {
  return (price - priceStats.min) / (priceStats.max - priceStats.min);
}
